;;; The first is satisfiable, by a single state, ```false false false```.  The latter is not satisfiable by design.  
;; **

;; **
;;; Internal note to be removed after bug is resolved.  I think we need to think pretty hard about the equal weight semantics of LMH when in the situation of returning samples that do not satisfy the imposed conditioning constraints.  As the language allows us to program dirac if we so wish, the behavior of the sampling algorithms should reflect that in their edge case behavior.  In no way are the samples returned from LMH below samples from the conditional distribution given the constraint.  We should insist that sampling algorithms either not return samples if a satisfying constraint cannot be found or return samples with weight -Inf when the ratio evaluates to -Inf/-Inf.  I can see arguments for either way of dealing with this problem. 
;;; 
;; **

;; @@
(->> (doquery :lmh Three-CNF-SAT [3 unsatisfiable-conjunction] :debug true :number-of-particles 100)
     (take 1000)
     (filter #(not (= Double/NEGATIVE_INFINITY (:embang.state/log-weight %))))
     (map get-predicts)
     (map :state)
     (map (uncps satisfiable-conjunction))
     ;(first)
     )
